import React, { Fragment } from "react";
import { makeStyles } from "@material-ui/core/styles";
import Grid from "@material-ui/core/Grid";
import headerBg from "../../img/home/header_bg.png";
import Box from "@material-ui/core/Box";
import Paper from "@material-ui/core/Paper";
import headerImg from "../../img/home/doctors-heart.png";
import { Typography } from "@material-ui/core";
import SearchTabs from "./SearchTabs";
import Location from "./Location";
import SearchIcon from "@material-ui/icons/Search";
import Button from "@material-ui/core/Button";

const useStyles = makeStyles((theme) => ({
  root: {
    flexGrow: 1,
  },

  grid: {
    position: "relative",
  },
  headerImg: {
    width: "30%",
    position: "absolute",
    right: 0,
    marginTop: 200,
    marginRight: 100,
  },

  headerBg: {
    width: "100%",
  },

  paper: {
    backgroundImage: `url(${headerBg})`,
    backgroundRepeat: "no-repeat",
    backgroundPosition: "center center",
    backgroundSize: "100% 100%",
    height: "100vh",
  },

  title: {
    color: "#fff",
  },

  headings: {
    marginTop: 200,
    //marginLeft: 100,
  },

  location: {
    //float: "left",
    //position: "relative",
  },
  search: {
    //float: "right",
    //position: "absolute",
  },

  /* leftGrid: {
    marginTop: 200,
    marginLeft: 30,
    //margin: "auto",
  },

  rightGrid: {
    marginTop: 80,
  }, */
}));
/*
const headerBackground = {
  backgroundImage: "url(" + headerBg + ")",
}; */
export default function Header() {
  const classes = useStyles();
  //className={classes.paper}
  /*<img
  src={headerBg}
  alt="doctor-hearts"
  className={classes.headerBg}
/> */

  return (
    <div>
      <Paper elevation={0} className={classes.paper}>
        <div className={classes.root}>
          <Grid
            container
            spacing={0}
            className={classes.grid}
            //direction="column"
            //alignItems="center"
            justify="center"
          >
            <Grid item xs={1}></Grid>
            <Grid item xs={5} className={classes.leftGrid}>
              <div className={classes.headings}>
                <Typography variant="h3" className={classes.title}>
                  Find your Ideal Doctor
                </Typography>
                <br></br>
                <Typography variant="h6" className={classes.title}>
                  Quick access to doctor information in Malaysia
                </Typography>
                <br></br>
                <Paper
                  elevation={0}
                  style={{ display: "inline-block", background: "#003367" }}
                >
                  <SearchTabs />
                  <Box flexDirection="row">
                    <Location className={classes.location}></Location>
                    <Button
                      variant="contained"
                      color="secondary"
                      startIcon={<SearchIcon />}
                      size="md"
                      className={classes.search}
                    ></Button>
                  </Box>
                </Paper>
              </div>
            </Grid>
            <Grid item xs={2}></Grid>

            <Grid item xs={4} className={classes.rightGrid}>
              <img
                src={headerImg}
                alt="doctor-hearts"
                className={classes.headerImg}
              />
            </Grid>
          </Grid>
        </div>
      </Paper>
    </div>
  );
}
